import { createStackNavigator } from 'react-navigation-stack';
import { createSwitchNavigator, createAppContainer } from 'react-navigation';
import { createBottomTabNavigator } from 'react-navigation-tabs';
import React from 'react';
import {Text, View } from 'react-native';

export const Home = ({ navigation })  => {
    return (
        <View>
            <Text onPress={() => navigation.navigate('Settings')}>Home</Text>
        </View>
    );
};

export const Login = ({ navigation })  => {
    return (
        <View>
            <Text onPress={() => navigation.navigate('Home')}>Login</Text>
        </View>
    );
};

export const Settings = ({ navigation })  => {
    return (
        <View>
            <Text>Settings</Text>
        </View>
    );
};

export const SignUp = ({ navigation })  => {
    return (
        <View>
            <Text onPress={() => navigation.navigate('Login')}>SignUp</Text>
        </View>
    );
};

const AppNavigation =   createBottomTabNavigator({
    Home: {screen: Home},
    Settings: {screen: Settings},

});

const AuthNavigation = createStackNavigator(
    {
        Login: { screen: Login },
        SignUp: { screen: SignUp }
    },
    {
        initialRouteName: 'SignUp',
        headerMode: 'none',
    }
);

const SwitchNavigator = createSwitchNavigator(
    {
        Auth: AuthNavigation,
        App: AppNavigation
    },
    {
        initialRouteName: 'Auth'
    }
);

export const AppContainer = createAppContainer(SwitchNavigator);
